import React from 'react'
import { withStyles,Link } from '@material-ui/core';
import FormInput from "./formInput/FormInput";

const useStyles = theme => ({
  container: {
    display: "flex",
    position :"fixed",
    alignItems:'center',
    width: '100vw',
    height: '100vh',
  },

  right: {
    padding: '15px',
    backgroundColor: '#424242',
    borderRadius: '20px',
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      width: '100%',
      height: '100%',
      borderRadius: '0px',
      overflowY: 'auto',
    },
  },

  left: {
    width: "70%",
    textAlign: 'center',
    [theme.breakpoints.down("sm")]:{
      display: 'none',
      width: "0vw",
    },

  },

  shareButton:{
    border: 'none',
    width: '60%',
    padding: '10px',
    background: 'green',
    color: 'white',
    fontWeight: '500',
    borderRadius: '5px',
    marginBottom: '10px',
    "&:hover": {
          background: 'green',
          fontWeight: 'bold',
    },
  },

})
export class SigninJs extends React.Component {

  inputs = [
    {
      id: 1,
      name: "username",
      type: "text",
      placeholder: "Username",
    },
    {
      id: 2,
      name: "password",
      type: "password",
      placeholder: "Password",
    },
  ];
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.container}>
        <div className={classes.left}>This is left</div>
        <div className={classes.right}>
            <h1 style={{color: 'lightgray'}}>Login</h1>
            {this.inputs.map((input) => (
              <FormInput
                key={input.id}
                {...input}
              />
            ))}
            <button className={classes.shareButton}>Login</button>
            <div>
            </div>
        </div>
      </div>
    )
  }
}

export default withStyles(useStyles)(SigninJs)
